// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

contract HealthcareDataManagement is AccessControl, Ownable {
    bytes32 public constant HEALTHCARE_PROVIDER_ROLE = keccak256("HEALTHCARE_PROVIDER_ROLE");

    struct Record {
        uint256 id;
        string dataHash;
        address owner;
        bool exists;
    }

    struct AccessLog {
        uint256 recordId;
        address accessedBy;
        uint256 timestamp;
    }

    mapping(uint256 => Record) private records;
    mapping(address => uint256[]) private ownerRecords;
    mapping(address => mapping(uint256 => bool)) private accessControl;
    AccessLog[] private accessLogs;
    uint256 private nextRecordId;

    event RecordCreated(uint256 id, address owner);
    event AccessGranted(uint256 id, address to);
    event AccessRevoked(uint256 id, address from);
    event RecordAccessed(uint256 id, address by);

    constructor(address admin) Ownable(admin) {
        _setupDefaultRoles(admin);
    }

    function _setupDefaultRoles(address admin) internal {
        _setupRole(DEFAULT_ADMIN_ROLE, admin);
        _setupRole(HEALTHCARE_PROVIDER_ROLE, admin);
    }

    function _setupRole(bytes32 role, address account) internal {
        grantRole(role, account);
    }

    modifier onlyOwnerOrProvider() {
        require(
            hasRole(HEALTHCARE_PROVIDER_ROLE, msg.sender) || owner() == msg.sender,
            "Only owner or healthcare provider can perform this action"
        );
        _;
    }

    function createRecord(string memory dataHash) public {
        uint256 recordId = nextRecordId++;
        records[recordId] = Record(recordId, dataHash, msg.sender, true);
        ownerRecords[msg.sender].push(recordId);
        emit RecordCreated(recordId, msg.sender);
    }

    function grantAccess(uint256 recordId, address to) public {
        require(records[recordId].exists, "Record does not exist");
        require(records[recordId].owner == msg.sender, "Only owner can grant access");
        accessControl[to][recordId] = true;
        emit AccessGranted(recordId, to);
    }

    function revokeAccess(uint256 recordId, address from) public {
        require(records[recordId].exists, "Record does not exist");
        require(records[recordId].owner == msg.sender, "Only owner can revoke access");
        accessControl[from][recordId] = false;
        emit AccessRevoked(recordId, from);
    }

    function getRecord(uint256 recordId) public onlyOwnerOrProvider returns (string memory) {
        require(records[recordId].exists, "Record does not exist");
        require(
            accessControl[msg.sender][recordId] || records[recordId].owner == msg.sender,
            "Access denied"
        );

        // Log the access
        accessLogs.push(AccessLog(recordId, msg.sender, block.timestamp));
        emit RecordAccessed(recordId, msg.sender);

        return records[recordId].dataHash;
    }

    function addHealthcareProvider(address provider) public onlyOwner {
        grantRole(HEALTHCARE_PROVIDER_ROLE, provider);
    }

    function removeHealthcareProvider(address provider) public onlyOwner {
        revokeRole(HEALTHCARE_PROVIDER_ROLE, provider);
    }

    function getAccessLogs() public view returns (AccessLog[] memory) {
        return accessLogs;
    }

    function getRecordsByOwner(address owner) public view returns (uint256[] memory) {
        return ownerRecords[owner];
    }
}

